import { BurgerIcon, ListIcon, Logo, ProfileIcon } from "@ya.praktikum/react-developer-burger-ui-components";

function Nav() {
    return (
        <header className={ styles.header }>
             <div className={styles.container} >
            <BurgerIcon/>
            <ListIcon/>
            <Logo/>
            <ProfileIcon/>
        </div>
        </header>
    )
};

export default Nav
